INSERT INTO `catalog_product_flat_3` VALUES (15,4,'simple',NULL,'2013-07-17 19:13:49',1,0,0,NULL,0,0,NULL,NULL,NULL,NULL,'4',2,'长篇小说-银行行长-说谎者和政客的博弈','2013-07-18 00:00:00',NULL,35.0000,NULL,NULL,NULL,0,NULL,'　本书是从微观角度切入，直击现代金融领域的小说。万福地产公司老总向银行贷款4个亿，在金明市机场附近的宋庄购买土地建贸易中心大厦和大型游乐场。宋庄村委克扣卖地款项，引起一些村民联名上告。上级展开逐层调查，责令银行立即停止对万福房地产公司贷款，并追回贷出去的款项。在复杂的局面下，银行行长刘茂林经历了一系列的人事纠葛和情感斗争……\r\n作者简介\r\n　　果红，原名陈果红，女，郑州市人，河南省作家协会会员。已出版长篇小说《荷之夭夭》、《凤凰梦华录》。\r\n目录\r\n第一章 山雨欲来风满楼\r\n第二章 士不可以不弘毅\r\n第三章 金融动荡','N02373',NULL,'/9/7/9787214078797_1.jpg',NULL,'2013-07-25 00:00:00',25.0000,NULL,2,'/9/7/9787214078797_1.jpg',NULL,'2013-08-16 22:51:41','9787214078797','9787214078797.html',4,0.6000,NULL),(16,4,'simple',NULL,'2013-07-17 19:13:52',1,0,0,NULL,NULL,0,NULL,NULL,NULL,NULL,'4',2,'婚久必昏','2013-07-18 00:00:00',NULL,32.0000,NULL,NULL,NULL,0,NULL,'　好的婚姻是你通过一个人看到整个世界，坏的婚姻是你为了一个人舍弃整个世界。\n　　婚姻如此漫长，一辈子真的只会爱身边的这个人吗？\n　　恋爱四年，结婚三年，孙萌萌和肖毅的婚姻渐渐变得宛如一潭死水。孙萌萌每天的生活都如此相似：准备早饭，送老公上班，准备晚饭，等老公下班……日复一日，温柔变成了习惯，习惯变成了麻烦。肖毅回家越来越晚，两人的话题越来越少，即使是同睡一张床，两个人之间也仿佛已是咫尺天涯。是爱不在了，还是他们都变了？一个陌生女人的出现将孙萌萌的“安逸”婚姻彻底打破，她的世界陷入了前所未有的危机……\n作者','N02374',NULL,'/9/7/9787540459895_1.jpg',NULL,NULL,NULL,NULL,2,'/9/7/9787540459895_1.jpg',NULL,'2013-07-17 20:12:51','9787540459895','9787540459895.html',4,0.6000,NULL),(17,4,'simple',NULL,'2013-07-17 19:13:54',1,0,0,NULL,NULL,0,NULL,NULL,NULL,NULL,'4',2,'画中情缘','2013-07-18 00:00:00',NULL,32.0000,NULL,NULL,NULL,0,NULL,'一个掩藏一生的秘密\n一段不被认可的爱情\n一次给受过创伤的心灵带来慰藉的机会\n      女画师埃拉不仅擅长画人物的脸和表情，更擅长捕捉他们内心深处最真实的情感。\n     一段“二战”时期父女生死永隔的秘事，一个害怕40岁到来的漂亮法国妇人，一个有私情的政治家……作画时，很多人向埃拉倾诉自己的故事，而埃拉的生世之谜也渐渐浮出水面。\n埃拉画画有自己的原则，比如，她从来不会依据照片来绘画，她需要有一个生动的人在眼前；她从来不会爱上自己的模特；她特别喜欢画那些略带忧郁、让她感觉复杂的人……可是当一个曾经令她憎恶的男人，','N02375',NULL,'/9/7/9787508636955_1.jpg',NULL,NULL,NULL,NULL,2,'/9/7/9787508636955_1.jpg',NULL,'2013-07-17 20:12:53','9787508636955','9787508636955.html',4,0.6000,NULL),(18,4,'simple',NULL,'2013-07-17 19:13:57',1,0,0,NULL,NULL,0,NULL,NULL,NULL,NULL,'4',2,'爱情的开关','2013-07-18 00:00:00',NULL,28.0000,NULL,NULL,NULL,0,NULL,'　如果爱一个人，是愿意让她独自活在天堂，还是愿意她陪伴自己陷在地狱？\n　　如果恨一个人，是愿意让她碎成齑粉，还是愿意她生不如死？\n　　从小随母亲改嫁到周家的小萌，与周家独子周衍照成为兄妹。青梅竹马的相处，让这对“兄妹”互生爱慕之心。当两人决心为爱远走的时候，周衍照的父亲意外出了车祸，而这场车祸的始因竟然是小萌的母亲蓄意设计的……\n　　周衍照接手了因车祸瘫痪并智力退化的父亲的“生意”，稚气的少年瞬间成长为南阅的黑道老大，人称“十哥”。然而，长辈之间的恩怨情仇却成为一道他与小萌都无法逾越的鸿沟。\n　　始于恨，','N02376',NULL,'/9/7/9787510436741_1.jpg',NULL,NULL,NULL,NULL,2,'/9/7/9787510436741_1.jpg',NULL,'2013-07-17 20:12:55','9787510436741','9787510436741.html',4,0.6000,NULL),(19,4,'simple',NULL,'2013-07-17 19:13:59',1,0,0,NULL,NULL,0,NULL,NULL,NULL,NULL,'4',2,'皂香','2013-07-18 00:00:00',NULL,32.0000,NULL,NULL,NULL,0,NULL,' 市规划局办公室主任洪均正在经历一场决定他仕途命运的竞聘，副局长之位近在眼前，而吴书记和孙局长才是决定竞选结构的关键人物。此时，洪均的妻子虞可人惨遭横祸，瘫痪在家，本是红颜知己的黄缨儿却在洪均心力交瘁之际与吴书记产生了莫名的关系，而洪均偶遇认识的王小薏已经开始对他有了额外的企图……\n　　律师于乐整天混迹于当事人和法官之间，一次偶然，他卷入了与一对姐妹花的男女关系当中，天真的妹妹不知道姐姐与于乐的关系，而姐姐却在对妹妹的愧疚中做出了一个惊人的决定……\n作者简介\n　　浮石，真名胡刚。毕业于湘潭大学哲学系，曾任','N02377',NULL,'/9/7/9787214075680_1.jpg',NULL,NULL,NULL,NULL,2,'/9/7/9787214075680_1.jpg',NULL,'2013-07-17 20:12:58','9787214075680','9787214075680.html',4,0.6000,NULL),(20,4,'simple',NULL,'2013-07-17 19:14:02',1,0,0,NULL,NULL,0,NULL,NULL,NULL,NULL,'4',2,'周南解密港澳回归中英及中葡谈判台前幕后','2013-07-18 00:00:00',NULL,48.0000,NULL,NULL,NULL,0,NULL,'　周南先生曾先后就读于北京大学及燕京大学，新中国成立后任教于北京外国语学校，后进入外交部，1983年起任外交部部长助理，1984年任外交部副部长，1990年出任新华社香港分社社长。周南先生长期参与外交活动，特别是亲自参与中英关于香港问题及中葡关于澳门问题的谈判，经历了中英及中葡谈判艰难曲折的进程，是香港回归全过程的亲历者和见证者。本书真实记录了诗人外交家周南丰富多彩而又曲折复杂的人生经历，资料翔实，内容真实权威，特别是披露了很多中英关于香港问题及中葡关于澳门问题谈判过程中鲜为人知的细节，再现了重大历史事件','PM00151',NULL,'/9/7/9787516603000_1.jpg',NULL,NULL,NULL,NULL,2,'/9/7/9787516603000_1.jpg',NULL,'2013-07-17 20:13:00','9787516603000','9787516603000.html',4,0.6000,NULL),(21,4,'simple',NULL,'2013-07-17 19:14:04',1,0,0,NULL,NULL,0,NULL,NULL,NULL,NULL,'4',2,'美国女兵','2013-07-18 00:00:00',NULL,28.0000,NULL,NULL,NULL,0,NULL,'　与其说战争因女性而变得阴柔，不如说女性因战争而更阳刚。当战争让女人走近，她们将不再是战场上点缀绿叶的鲜花、男人们驻足观看的风景，而是坚强的战士，真正的军人。美国女兵在战场上与男人一样出生入死，却要承受更多不为人知、难于启齿的磨难与艰辛。《美国女兵》将作为国内首部全景式披露美国女兵真实军营生活的作品出版面世。\n作者简介\n　　邵永灵，女，1966年出生，黑龙江人，1991年入伍。先后毕业于山东大学、南京大学国际关系学院，获国际关系博士学位。中国人民解放军第二炮兵指挥学院指挥系一级教授，军事战略专业博士研究生','PM00152',NULL,'/9/7/9787205075156_1.jpg',NULL,NULL,NULL,NULL,2,'/9/7/9787205075156_1.jpg',NULL,'2013-07-17 20:13:02','9787205075156','9787205075156.html',4,0.6000,NULL),(22,4,'simple',NULL,'2013-07-17 19:14:07',1,0,0,NULL,NULL,0,NULL,NULL,NULL,NULL,'4',2,'中国人的思维批判','2013-07-18 00:00:00',NULL,30.0000,NULL,NULL,NULL,0,NULL,'　　楚渔，姓楚名子渔，字村夫，自由职业者。湖南新化人（今湖南省新邵县），现居于北京西山，自号西山闲人，收藏家、探险家和旅行家。从古玩字画到当代珍奇，收藏颇丰。尤其酷爱大自然，1年中大多数时间在野外生存。从珠穆朗玛峰到南极，从西伯利亚到亚马逊河，从可可西里和墨脱的无人区到非洲撒哈拉大沙漠，越是严酷恶劣的环境他越喜欢。曾主编《走上神坛的岳飞》，参与编辑《壮怀激烈》。 楚渔以自己对人生的独特感悟和融入自然的博大情怀，写下了独具见解的哲学著作《中国人的思维批判》。他的这部宏论就大多是在乒乓球室里写成的。打会儿乒乓','CU00593',NULL,'/9/7/9787010096667_1.jpg',NULL,NULL,NULL,NULL,2,'/9/7/9787010096667_1.jpg',NULL,'2013-07-17 20:13:05','9787010096667','9787010096667.html',4,0.6000,NULL),(23,4,'simple',NULL,'2013-07-17 19:14:09',1,0,0,NULL,NULL,0,NULL,NULL,NULL,NULL,'4',2,'山河岁月','2013-07-18 00:00:00',NULL,32.0000,NULL,NULL,NULL,0,NULL,'　《山河岁月》：胡兰成最具代表性的作品，作者称此书是一本“正经的闲书”，是其学问体系的基础。作者在书中将东西方文化进行纵横比照，从两河流域到希腊罗马，从三皇五帝到辛亥五四，从精神到食色，从住房到穿衣，传神地勾勒出中国文明和世界文明发展的发肤体貌。在他看来，中国的文明好到可以统摄世界文明，中国的文化亦毫不逊色于西方的文化。\n\n\n作者简介\n　　胡兰成（1906—1981），出生于浙江嵊县胡村，卒于日本东京。青年时代曾于燕京大学旁听课程，后在浙江、广西等地任教。抗战时任《中华日报》总主笔等职，期间与张爱玲结婚。','CU00594',NULL,'/9/7/9787510705502_1.jpg',NULL,NULL,NULL,NULL,2,'/9/7/9787510705502_1.jpg',NULL,'2013-07-17 20:13:07','9787510705502','9787510705502.html',4,0.6000,NULL),(24,4,'simple',NULL,'2013-07-17 19:14:12',1,0,0,NULL,NULL,0,NULL,NULL,NULL,NULL,'4',2,'颐和园传说','2013-07-18 00:00:00',NULL,58.0000,NULL,NULL,NULL,0,NULL,'    崔墨卿和甄玉金编著的《颐和园传说》围绕着颐和园的修建历史、园林建筑、人物风情、趣闻逸事，曾经产生过大量民间传说和故事。民间传说是人类文化的早期启蒙和宝贵结晶。许多流传悠久、脍炙人口的神话故事，最早都属于民间传说，如嫦娥奔月、牛郎织女、粱山伯与祝英台等。清代文学家蒲松龄先生一部闻名中外的《聊斋志异》，可谓是民间鬼狐故事的结集。由于两千年来中国封建专制的盛行，中国的民间文学其实可视为正统文化和历史的重要补充，甚至可能更接近真实。\n目录\n序\n序\n第一章 颐和园及建园传说\n第二章 建园传说\n一 “样式雷”巧设','CU00595',NULL,'/9/7/9787805014616_1.jpg',NULL,NULL,NULL,NULL,2,'/9/7/9787805014616_1.jpg',NULL,'2013-07-17 20:13:09','9787805014616','9787805014616.html',4,0.6000,NULL),(25,4,'simple',NULL,'2013-07-17 19:14:14',1,0,0,NULL,NULL,0,NULL,NULL,NULL,NULL,'4',2,'风生水起好运来旺人.旺家.旺业2013年全新修订版','2013-07-18 00:00:00',NULL,68.0000,NULL,NULL,NULL,0,NULL,'命是一个人的先天禀赋，运则是在时间流程中的运动规律。周围环境、景观、外形结构、方位色彩等信息，对人生、事业、身心健康都会产生重大影响。《风生水起好运来》解密了风水对人生的影响，以及办公置业、宅地选择、居家健康、事业爱情等与风水的关系，让你的家庭、事业、爱情统统旺起来。\n目录\n第一章　造命有理：风水对人生的影响我们究竟要不要相信命运风水改变命运从出生年份看人的命运从出生节气看人的命运运势变不好的三大原因让你的“运气”逢凶化吉一生必修的生活“潜规则”第二章　听风说水：说说什么是风水我们如何认识风水气和阴阳五行','CU00596',NULL,'/9/7/9787510415982_1.jpg',NULL,NULL,NULL,NULL,2,'/9/7/9787510415982_1.jpg',NULL,'2013-07-17 20:13:12','9787510415982','9787510415982.html',4,0.6000,NULL),(26,4,'simple',NULL,'2013-07-17 19:14:18',1,0,0,NULL,NULL,0,NULL,NULL,NULL,NULL,'4',2,'最后的闺秀','2013-07-18 00:00:00',NULL,28.0000,NULL,NULL,NULL,0,NULL,'     叶圣陶曾说：“九如巷张家的四个才女，谁娶了她们都会幸福一辈子。”这四个才貌双全的女子便是张元和、张允和、张兆和、张充和。在苏州园林中长大的闺秀经历着从传统到现代的历史蜕变，诗情画意的生活与错综复杂的命运不亚于宋氏三姐妹。二姐允和是四姐妹中最灵秀、最风趣的一位，被称为最后的闺秀，《最后的闺秀》是她的处女作，也是她唯一一本完整的个人自传体随笔。《最后的闺秀》里记录的是逝去的岁月、历史的伤痕所无法遮掩的暖暖的爱意——父母恩宠、伉俪情深、姐妹情谊、儿孙之福、昆曲之爱……其中无论是传记轶闻还是稚子童言，莫不生','F01133',NULL,'/9/7/9787108041418_1.jpg',NULL,NULL,NULL,NULL,2,'/9/7/9787108041418_1.jpg',NULL,'2013-07-17 20:13:15','9787108041418','9787108041418.html',4,0.6000,NULL),(27,4,'simple',NULL,'2013-07-17 19:14:20',1,0,0,NULL,0,0,NULL,NULL,NULL,NULL,'4',2,'演绎无声','2013-07-18 00:00:00',NULL,57.0000,NULL,NULL,NULL,0,NULL,'《演绎无声》是我国第一部以实际感受和案例系统论述演出经纪理论与实践的前沿专著，对希望从事演出经纪活动和观察研究台前幕后的人士具有指导和借鉴意义。作者翟新华从事过导演、摄影师、经纪人等职业，已成功举办有上千场次的演出活动，参与了多部影视剧的制作拍摄，具有丰富的人生经历和文化产业运作经验。本书通过作者翟新华的亲身经历，细述了从策划、组织到运作、实施演出活动时的具体过程，近距离接触各种明星的感受，以及行走于大江南北，在全国各地所发生的成功与失败的曲折故事。\r\n作者简介\r\n　　翟新华，山东惠民人，生于1964年，北京','F01134',NULL,'/9/7/9787517200529_1.jpg',NULL,NULL,NULL,NULL,2,'/9/7/9787517200529_1.jpg',NULL,'2013-09-02 09:30:29','9787517200529','9787517200529.html',4,0.6000,NULL);
