 risus. Proin scelerisque augue. Nam ullamcorper. Phasellus id massa. Pellentesque nisl. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Nunc augue. Aenean sed justo non leo vehicula laoreet. Praesent ipsum libero, auctor ac, tempus nec, tempor nec, justo.</dd>\r\n</dl>','2011-09-05 21:35:15','2011-09-05 21:35:15',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(5,'Enable Cookies','one_column',NULL,NULL,'enable-cookies',NULL,'<div class=\"std\">\r\n    <ul class=\"messages\">\r\n        <li class=\"notice-msg\">\r\n            <ul>\r\n                <li>Please enable cookies in your web browser to continue.</li>\r\n            </ul>\r\n        </li>\r\n    </ul>\r\n    <div class=\"page-title\">\r\n        <h1><a name=\"top\"></a>What are Cookies?</h1>\r\n    </div>\r\n    <p>Cookies are short pieces of data that are sent to your computer when you visit a website. On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically whenever you visit our site so that we can personalize your experience and provide you with better service. We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes. If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase or take advantage of certain features of our website, such as storing items in your Shopping Cart or receiving personalized recommendations. As a result, we strongly encourage you to configure your web browser to accept cookies from our website.</p>\r\n    <h2 class=\"subtitle\">Enabling Cookies</h2>\r\n    <ul class=\"disc\">\r\n        <li><a href=\"#ie7\">Internet Explorer 7.x</a></li>\r\n        <li><a href=\"#ie6\">Internet Explorer 6.x</a></li>\r\n        <li><a href=\"#firefox\">Mozilla/Firefox</a></li>\r\n        <li><a href=\"#opera\">Opera 7.x</a></li>\r\n    </ul>\r\n    <h3><a name=\"ie7\"></a>Internet Explorer 7.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Start Internet Explorer</p>\r\n        </li>\r\n        <li>\r\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-1.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Privacy</strong> tab</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-2.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Advanced</strong> button</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-3.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>, put another check mark in the <strong>Always accept session cookies </strong>box</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-4.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click <strong>OK</strong></p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-5.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click <strong>OK</strong></p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie7-6.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Restart Internet Explore</p>\r\n        </li>\r\n    </ol>\r\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\r\n    <h3><a name=\"ie6\"></a>Internet Explorer 6.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie6-1.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> tab</p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>) under <strong>Settings</strong>. Click <strong>OK</strong></p>\r\n            <p><img src=\"{{skin url=\"images/cookies/ie6-2.gif\"}}\" alt=\"\" /></p>\r\n        </li>\r\n    </ol>\r\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\r\n    <h3><a name=\"firefox\"></a>Mozilla/Firefox</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/firefox.png\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Expand the <strong>Cookies</strong> section</p>\r\n        </li>\r\n        <li>\r\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\r\n        </li>\r\n        <li>\r\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\r\n        </li>\r\n    </ol>\r\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\r\n    <h3><a name=\"opera\"></a>Opera 7.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\r\n            <p><img src=\"{{skin url=\"images/cookies/opera.png\"}}\" alt=\"\" /></p>\r\n        </li>\r\n        <li>\r\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong> should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\r\n        </li>\r\n        <li>\r\n            <p>Save changes by clicking <strong>Ok</strong></p>\r\n        </li>\r\n    </ol>\r\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\r\n</div>\r\n','2011-09-05 21:35:17','2011-09-05 21:35:17',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(6,'Privacy Policy','one_column',NULL,NULL,'privacy-policy-cookie-restriction-mode','Privacy Policy','<p style=\"color: #ff0000; font-weight: bold; font-size: 13px\">\n    Please replace this text with you Privacy Policy.\n    Please add any additional cookies your website uses below (e.g., Google Analytics)\n</p>\n<p>\n    This privacy policy sets out how {{config path=\"general/store_information/name\"}} uses and protects any information\n    that you give {{config path=\"general/store_information/name\"}} when you use this website.\n    {{config path=\"general/store_information/name\"}} is committed to ensuring that your privacy is protected.\n    Should we ask you to provide certain information by which you can be identified when using this website,\n    then you can be assured that it will only be used in accordance with this privacy statement.\n    {{config path=\"general/store_information/name\"}} may change this policy from time to time by updating this page.\n    You should check this page from time to time to ensure that you are happy with any changes.\n</p>\n<h2>What we collect</h2>\n<p>We may collect the following information:</p>\n<ul>\n    <li>name</li>\n    <li>contact information including email address</li>\n    <li>demographic information such as postcode, preferences and interests</li>\n    <li>other information relevant to customer surveys and/or offers</li>\n</ul>\n<p>\n    For the exhaustive list of cookies we collect see the <a href=\"#list\">List of cookies we collect</a> section.\n</p>\n<h2>What we do with the information we gather</h2>\n<p>\n    We require this information to understand your needs and provide you with a better service,\n    and in particular for the following reasons:\n</p>\n<ul>\n    <li>Internal record keeping.</li>\n    <li>We may use the information to improve our products and services.</li>\n    <li>\n        We may periodically send promotional emails about new products, special offers or other information which we\n        think you may find interesting using the email address which you have provided.\n    </li>\n    <li>\n        From time to time, we may also use your information to contact you for market research purposes.\n        We may contact you by email, phone, fax or mail. We may use the information to customise the website\n        according to your interests.\n    </li>\n</ul>\n<h2>Security</h2>\n<p>\n    We are committed to ensuring that your information is secure. In order to prevent unauthorised access or disclosure,\n    we have put in place suitable physical, electronic and managerial procedures to safeguard and secure\n    the information we collect online.\n</p>\n<h2>How we use cookies</h2>\n<p>\n    A cookie is a small file which asks permission to be placed on your computer\'s hard drive.\n    Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit\n    a particular site. Cookies allow web applications to respond to you as an individual. The web application\n    can tailor its operations to your needs, likes and dislikes by gathering and remembering information about\n    your preferences.\n</p>\n<p>\n    We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page traffic\n    and improve our website in order to tailor it to customer needs. We only use this information for statistical\n    analysis purposes and then the data is removed from the system.\n</p>\n<p>\n    Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find useful\n    and which you do not. A cookie in no way gives us access to your computer or any information about you,\n    other than the data you choose to share with us. You can choose to accept or decline cookies.\n    Most web browsers automatically accept cookies, but you can usually modify your browser setting\n    to decline cookies if you prefer. This may prevent you from taking full advantage of the website.\n</p>\n<h2>Links to other websites</h2>\n<p>\n    Our website may contain links to other websites of interest. However, once you have used these links\n    to leave our site, you should note that we do not have any control over that other website.\n    Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst\n    visiting such sites and such sites are not governed by this privacy statement.\n    You should exercise caution and look at the privacy statement applicable to the website in question.\n</p>\n<h2>Controlling your personal information</h2>\n<p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\n<ul>\n    <li>\n        whenever you are asked to fill in a form on the website, look for the box that you can click to indicate\n        that you do not want the information to be used by anybody for direct marketing purposes\n    </li>\n    <li>\n        if you have previously agreed to us using your personal information for direct marketing purposes,\n        you may change your mind at any time by writing to or emailing us at\n        {{config path=\"trans_email/ident_general/email\"}}\n    </li>\n</ul>\n<p>\n    We will not sell, distribute or lease your personal information to third parties unless we have your permission\n    or are required by law to do so. We may use your personal information to send you promotional information\n    about third parties which we think you may find interesting if you tell us that you wish this to happen.\n</p>\n<p>\n    You may request details of personal information which we hold about you under the Data Protection Act 1998.\n    A small fee will be payable. If you would like a copy of the information held on you please write to\n    {{config path=\"general/store_information/address\"}}.\n</p>\n<p>\n    If you believe that any information we are holding on you is incorrect or incomplete,\n    please write to or email us as soon as possible, at the above address.\n    We will promptly correct any information found to be incorrect.\n</p>\n<h2><a name=\"list\"></a>List of cookies we collect</h2>\n<p>The table below lists the cookies we collect and what information they store.</p>\n<table class=\"data-table\">\n    <thead>\n        <tr>\n            <th>COOKIE name</th>\n            <th>COOKIE Description</th>\n        </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <th>CART</th>\n            <td>The association with your shopping cart.</td>\n        </tr>\n        <tr>\n            <th>CATEGORY_INFO</th>\n            <td>Stores the category info on the page, that allows to display pages more quickly.</td>\n        </tr>\n        <tr>\n            <th>COMPARE</th>\n            <td>The items that you have in the Compare Products list.</td>\n        </tr>\n        <tr>\n            <th>CURRENCY</th>\n            <td>Your preferred currency</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER</th>\n            <td>An encrypted version of your customer id with the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_AUTH</th>\n            <td>An indicator if you are currently logged into the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_INFO</th>\n            <td>An encrypted version of the customer group you belong to.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_SEGMENT_IDS</th>\n            <td>Stores the Customer Segment ID</td>\n        </tr>\n        <tr>\n            <th>EXTERNAL_NO_CACHE</th>\n            <td>A flag, which indicates whether caching is disabled or not.</td>\n        </tr>\n        <tr>\n            <th>FRONTEND</th>\n            <td>You sesssion ID on the server.</td>\n        </tr>\n        <tr>\n            <th>GUEST-VIEW</th>\n            <td>Allows guests to edit their orders.</td>\n        </tr>\n        <tr>\n            <th>LAST_CATEGORY</th>\n            <td>The last category you visited.</td>\n        </tr>\n        <tr>\n            <th>LAST_PRODUCT</th>\n            <td>The most recent product you have viewed.</td>\n        </tr>\n        <tr>\n            <th>NEWMESSAGE</th>\n            <td>Indicates whether a new message has been received.</td>\n        </tr>\n        <tr>\n            <th>NO_CACHE</th>\n            <td>Indicates whether it is allowed to use cache.</td>\n        </tr>\n        <tr>\n            <th>PERSISTENT_SHOPPING_CART</th>\n            <td>A link to information about your cart and viewing history if you have asked the site.</td>\n        </tr>\n        <tr>\n            <th>POLL</th>\n            <td>The ID of any polls you have recently voted in.</td>\n        </tr>\n        <tr>\n            <th>POLLN</th>\n            <td>Information on what polls you have voted on.</td>\n        </tr>\n        <tr>\n            <th>RECENTLYCOMPARED</th>\n            <td>The items that you have recently compared.            </td>\n        </tr>\n        <tr>\n            <th>STF</th>\n            <td>Information on products you have emailed to friends.</td>\n        </tr>\n        <tr>\n            <th>STORE</th>\n            <td>The store view or language you have selected.</td>\n        </tr>\n        <tr>\n            <th>USER_ALLOWED_SAVE_COOKIE</th>\n            <td>Indicates whether a customer allowed to use cookies.</td>\n        </tr>\n        <tr>\n            <th>VIEWED_PRODUCT_IDS</th>\n            <td>The products that you have recently viewed.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST</th>\n            <td>An encrypted list of products added to your Wishlist.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST_CNT</th>\n            <td>The number of items in your Wishlist.</td>\n        </tr>\n    </tbody>\n</table>','2013-07-17 15:36:22','2013-07-17 15:36:22',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(8,'Test Page','three_columns',NULL,NULL,'test-page',NULL,'Sample Test Page','2013-07-17 17:53:58','2013-07-17 17:53:58',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(9,'page-for-libraries','three_columns',NULL,NULL,'page-for-libraries',NULL,'\r\n<div style=\"border:25px white solid;\">\r\n\r\n\r\n<p align=\"center\"><font face=\"Arial\" size=\"2\"><span style=\"font-family: Arial; font-size: 10pt\"><strong><font color=\"#339966\"><strong><span style=\"line-height: 115%; font-family: \'Baskerville Old Face\', serif; color: #548dd4; font-size: 20pt\">CC Books is also a Library Supplier</span></strong></font></strong></span></font> </p><p align=\"justify\"><strong><font face=\"Arial\" size=\"2\"><span style=\"font-family: Arial; font-size: 10pt; font-weight: bold\">MAGAZINES</span></font></strong></p><p class=\"EC_MsoNormal\" align=\"justify\"><font face=\"Arial\" size=\"2\"><span style=\"font-family: Arial; font-size: 10pt\">We can supply over 6000 titles of Magazines and Newspapers published in China. Out of which, over 60 of the most in demand titles we keep in stock. They belong to the categories of: Fashion and Beauty, Family & Culture, Military and Weapons, Literature and Fiction, Current Affairs and Hobbies. If we don’t stock the titles you are after, we can subscribe them for you. </span></font></p><p class=\"EC_MsoNormal\" align=\"justify\"><font face=\"Arial\" size=\"2\"><span style=\"font-family: Arial; font-size: 10pt\">Our prices are very competitive. Unlike other suppliers which might send you issues one by one from China as they come out, we keep the prices down by having all the issues sent over with our stock and send them out to you in bulk locally on a monthly base if you order more than 1 title, which can save a large amount of money for you on shipping costs. Like many other libraries, the titles you order depend on the requests of your customers. However, if you need help selecting more titles, we can suggest a few based on the demands of Chinese magazines sold locally through our Magazine retail locations around Melbourne.</span></font></p><p class=\"EC_MsoNormal\" align=\"justify\"><font face=\"Arial\" size=\"2\"><span style=\"font-family: Arial; font-size: 10pt; font-weight: bold\">BOOKS & DVDS</span></font></p><p class=\"EC_MsoNormal\" align=\"justify\"><font face=\"Arial\" size=\"2\"><span style=\"font-family: Arial; font-size: 10pt\">We supply Books and DVDs of all categories. Our shipment arrives every month to ensure that our stock is the newest and most popular on the market. Currently we supply to over 10 Local Libraries and University Libraries in Melbourne on a regular basis. So you can be sure that we are familiar with the industry and provide the best service we can in order to serve our clients. </span></font></p><p class=\"EC_MsoNormal\" align=\"justify\"><font face=\"Arial\" size=\"2\"><span style=\"font-family: Arial; font-size: 10pt\"><span style=\"font-family: Arial; font-size: 10pt\"><span style=\" font-family: Arial, sans-serif; color: #333333; font-size: 10pt\">We can assist you in selecting the categories you require. If you do not understand the language or do not have the resources to select them yourself. We can help you select the newest and most popular titles in that category for you. We keep records of all the titles we supply to ensure that we don\'t supply multiple copies of titles you already have. We also provide an excel list with Title, ISBN Price etc. and any other data you may require to assist you in identifying the books to enter into your system. </span></span></span></font></p><p class=\"EC_MsoNormal\"><font face=\"Arial\" size=\"2\"><span style=\"font-family: Arial; font-size: 10pt\"><strong>SPECIAL ORDERS</strong> </span></font></p><p class=\"EC_MsoNormal\" align=\"justify\"><font face=\"Arial\" size=\"2\"><span style=\"font-family: Arial; font-size: 10pt\">If we don\'t have the</span></font><span style=\"font-family: Arial; font-size: 10pt\"> </span><font face=\"Arial\" size=\"2\"><span style=\"font-family: Arial; font-size: 10pt\"><font face=\"Tahoma\"> etc... </font> </span></font></p><p class=\"EC_MsoNormal\"><span class=\"STYLE143\">If you are interested in ordering from us, please contact us for more information. We look foward to hearing from you.</span></p><p class=\"EC_MsoNormal\"><span class=\"STYLE143\">The site will be updated regularly so please visit again for more new titles.</span></p><p align=\"center\">All Orders are welcome. </p><div align=\"center\"><span class=\"style79\">Ph:</span> (03) 93806334 <span class=\"style101\"><span class=\"style79\">Email</span>:</span> info@ccbooks.com.au </div>\r\n\r\n\r\n</div>','2013-07-17 17:53:58','2013-07-17 20:51:32',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(10,'page-for-schools','three_columns',NULL,NULL,'page-for-schools',NULL,'<div style=\"border:25px white solid;\">\r\n\r\n\r\n<table border=\"0\" cellspacing=\"1\" cellpadding=\"5\" width=\"100%\"><tbody><tr><td class=\"STYLE11\" width=\"79%\" align=\"center\" valign=\"top\"><p align=\"justify\">CC Books have been supplying Textbooks, Dictionaries, Pinyin Books, Student reading and learning materials to a number of schools around Melbourne since 2002. We have an extensive range of books to suit students of all ages as well as teaching materials. Depending on the age and level of the students in your school, we can help you select the most suitable titles to help them learn and improve. We can also supply books for students who are already fluent in the language, categories such as: modern literature, Chinese Culture, Self motivation, and effective essay writing books are also very popular with many schools we have supplied to before. If you would like to get an idea of the type of books we can supply, you can start by browing through the following links:</p><table border=\"1\" cellpadding=\"1\" width=\"306\" align=\"center\"><tbody><tr><th width=\"154\" scope=\"col\">Books</th><th width=\"136\" scope=\"col\">DVDs</th></tr><tr><td>-<a href=\"{{config path=\"web/unsecure/base_url\"}}index.php/children.html\" target=\"_blank\">Children\'s Books</a></td><td><a href=\"{{config path=\"web/unsecure/base_url\"}}index.php/dvdandcd/traveldvds.html\" target=\"_blank\">-China Travel </a></td></tr><tr>\r\n\r\n<td>-<a href=\"{{config path=\"web/unsecure/base_url\"}}index.php/dictionary.html\" target=\"_blank\">Dictionaries</a></td>\r\n<td><a href=\"{{config path=\"web/unsecure/base_url\"}}index.php/dvdandcd/historyandculture.html\" target=\"_blank\">-History & Culture</a></td></tr><tr>\r\n<td>-<a href=\"{{config path=\"web/unsecure/base_url\"}}index.php/chinesetextbooks.html\" target=\"_blank\">Chinese Textbooks</a></td>\r\n<td>-<a href=\"{{config path=\"web/unsecure/base_url\"}}index.php/dvdandcd/discovery.html\" target=\"_blank\">Discovery </a></td></tr><tr><td><a href=\"{{config path=\"web/unsecure/base_url\"}}index.php/familyeducation.html\" target=\"_blank\">-Family Education</a></td>\r\n<td><a href=\"{{config path=\"web/unsecure/base_url\"}}index.php/dvdandcd/childrensdvd.html\" target=\"_blank\">-Children\'s DVD</a></td></tr></tbody></table><p>Feel free to contact us if you would like more information or want to come in and see for yourselves. We can also send you updates in our mailing list for catalogues and new arrival details. </p><p align=\"center\">All Orders are welcome. </p><p align=\"center\">&nbsp;</p></td></tr><tr><td class=\"STYLE11\" align=\"center\" valign=\"top\"><div align=\"center\"><span class=\"style79\">Ph:</span> (03) 93806334 <span class=\"style101\"><span class=\"style79\">Email</span>:</span> info@ccbooks.com.au </div></td></tr><tr><td class=\"STYLE11\" align=\"center\" valign=\"top\"> </td></tr></tbody></table>\r\n\r\n</div>','2013-07-17 17:53:58','2013-07-17 18:25:55',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(11,'page-wholesale','three_columns',NULL,NULL,'page-wholesale',NULL,'<div style=\"border:25px white solid;\">\r\n\r\n\r\n<span ><p align=\"center\"><span >If you would like to become a reseller of our Chinese books and Magazines, please contact us for more information. </span></p><p align=\"center\"><span>如果您想代销或包销长城图书的书和杂志，请和我们联系。 </span></p><p align=\"center\"><span >Tel: 03 9380 6334</span></p><p align=\"center\"><span><a href=\"mailto:info@ccbooks.com.au\"><u><font color=\"#0000ff\">info@ccbooks.com.au</font></u></a> <span style=\"display: none\">This e-mail address is being protected from spambots. You need JavaScript enabled to view it </span></span></p></span>\r\n\r\n</div>','2013-07-17 17:53:59','2013-07-17 18:29:40',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(12,'page-special-orders','three_columns',NULL,NULL,'page-special-orders',NULL,'<div style=\"border:25px white solid;\">\r\n\r\n\r\n<p><font size=\"3\"><span style=\"font-family: 宋体; color: #333333\"><span style=\"font-family: 宋体; color: #333333; font-size: 10pt\">• 如果您没有在长城图书网上找到您想要的书，我们可以专门为您订购。</span></span></font><font size=\"3\"><span style=\"font-family: 宋体; color: #333333\"><span style=\"font-family: Tahoma; color: #333333; font-size: 10pt\">无论是</span></span></font><font size=\"3\"><span style=\"font-family: 宋体; color: #333333\"><span style=\"font-family: Tahoma; color: #333333; font-size: 10pt\">畅销书，港台书，禁书，绝版书，小儿书，研究性书 等等 都可以供应。</span></span></font><font size=\"3\"><span style=\"font-family: 宋体; color: #333333\"><span style=\"font-family: 宋体; color: #333333; font-size: 10pt\">一般</span><span style=\"font-family: Tahoma; color: #333333; font-size: 10pt\">6-8</span><span style=\"font-family: 宋体; color: #333333; font-size: 10pt\">周到货 </span></span></font><font size=\"3\"><span style=\"font-family: 宋体; color: #333333\"><span style=\"font-family: 宋体; color: #333333; font-size: 10pt\">请提供：书名</span><span style=\"font-family: Tahoma; color: #333333; font-size: 10pt\">, ISBN, </span><span style=\"fon