urring\";s:2:\"No\";s:10:\"visibility\";s:15:\"Catalog, Search\";s:21:\"enable_googlecheckout\";s:3:\"Yes\";s:12:\"tax_class_id\";s:13:\"Taxable Goods\";s:8:\"featured\";s:3:\"Yes\";s:11:\"description\";s:6:\"&nbsp;\";s:17:\"short_description\";s:745:\"    崔墨卿和甄玉金编著的《颐和园传说》围绕着颐和园的修建历史、园林建筑、人物风情、趣闻逸事，曾经产生过大量民间传说和故事。民间传说是人类文化的早期启蒙和宝贵结晶。许多流传悠久、脍炙人口的神话故事，最早都属于民间传说，如嫦娥奔月、牛郎织女、粱山伯与祝英台等。清代文学家蒲松龄先生一部闻名中外的《聊斋志异》，可谓是民间鬼狐故事的结集。由于两千年来中国封建专制的盛行，中国的民间文学其实可视为正统文化和历史的重要补充，甚至可能更接近真实。\n目录\n序\n序\n第一章 颐和园及建园传说\n第二章 建园传说\n一 “样式雷”巧设\";s:17:\"special_from_date\";s:0:\"\";s:14:\"news_from_date\";s:19:\"2013-07-18 00:00:00\";s:3:\"qty\";s:7:\"25.0000\";s:7:\"min_qty\";s:6:\"0.0000\";s:18:\"use_config_min_qty\";s:1:\"1\";s:14:\"is_qty_decimal\";s:1:\"0\";s:10:\"backorders\";s:1:\"0\";s:21:\"use_config_backorders\";s:1:\"1\";s:12:\"min_sale_qty\";s:6:\"1.0000\";s:23:\"use_config_min_sale_qty\";s:1:\"1\";s:12:\"max_sale_qty\";s:6:\"0.0000\";s:23:\"use_config_max_sale_qty\";s:1:\"1\";s:11:\"is_in_stock\";s:1:\"1\";s:14:\"low_stock_date\";s:0:\"\";s:16:\"notify_stock_qty\";s:0:\"\";s:27:\"use_config_notify_stock_qty\";s:1:\"1\";s:12:\"manage_stock\";s:1:\"0\";s:23:\"use_config_manage_stock\";s:1:\"1\";s:25:\"stock_status_changed_auto\";s:1:\"0\";s:25:\"use_config_qty_increments\";s:1:\"1\";s:14:\"qty_increments\";s:6:\"0.0000\";s:25:\"use_config_enable_qty_inc\";s:1:\"1\";s:21:\"enable_qty_increments\";s:1:\"0\";s:18:\"is_decimal_divided\";s:1:\"0\";s:34:\"stock_status_changed_automatically\";s:1:\"0\";s:32:\"use_config_enable_qty_increments\";s:1:\"1\";s:12:\"product_name\";s:15:\"颐和园传说\";s:8:\"store_id\";s:1:\"0\";s:15:\"product_type_id\";s:6:\"simple\";s:22:\"product_status_changed\";s:0:\"\";s:24:\"product_changed_websites\";s:0:\"\";}',1),(11,1,'a:69:{s:5:\"store\";s:5:\"admin\";s:8:\"websites\";s:4:\"base\";s:13:\"attribute_set\";s:7:\"Default\";s:4:\"type\";s:6:\"simple\";s:12:\"category_ids\";s:2:\"15\";s:3:\"sku\";s:7:\"CU00596\";s:11:\"has_options\";s:1:\"0\";s:4:\"name\";s:63:\"风生水起好运