xable Goods\";s:8:\"featured\";s:3:\"Yes\";s:11:\"description\";s:6:\"&nbsp;\";s:17:\"short_description\";s:761:\"     叶圣陶曾说：“九如巷张家的四个才女，谁娶了她们都会幸福一辈子。”这四个才貌双全的女子便是张元和、张允和、张兆和、张充和。在苏州园林中长大的闺秀经历着从传统到现代的历史蜕变，诗情画意的生活与错综复杂的命运不亚于宋氏三姐妹。二姐允和是四姐妹中最灵秀、最风趣的一位，被称为最后的闺秀，《最后的闺秀》是她的处女作，也是她唯一一本完整的个人自传体随笔。《最后的闺秀》里记录的是逝去的岁月、历史的伤痕所无法遮掩的暖暖的爱意——父母恩宠、伉俪情深、姐妹情谊、儿孙之福、昆曲之爱……其中无论是传记轶闻还是稚子童言，莫不生\";s:17:\"special_from_date\";s:0:\"\";s:14:\"news_from_date\";s:19:\"2013-07-18 00:00:00\";s:3:\"qty\";s:7:\"25.0000\";s:7:\"min_qty\";s:6:\"0.0000\";s:18:\"use_config_min_qty\";s:1:\"1\";s:14:\"is_qty_decimal\";s:1:\"0\";s:10:\"backorders\";s:1:\"0\";s:21:\"use_config_backorders\";s:1:\"1\";s:12:\"min_sale_qty\";s:6:\"1.0000\";s:23:\"use_config_min_sale_qty\";s:1:\"1\";s:12:\"max_sale_qty\";s:6:\"0.0000\";s:23:\"use_config_max_sale_qty\";s:1:\"1\";s:11:\"is_in_stock\";s:1:\"1\";s:14:\"low_stock_date\";s:0:\"\";s:16:\"notify_stock_qty\";s:0:\"\";s:27:\"use_config_notify_stock_qty\";s:1:\"1\";s:12:\"manage_stock\";s:1:\"0\";s:23:\"use_config_manage_stock\";s:1:\"1\";s:25:\"stock_status_changed_auto\";s:1:\"0\";s:25:\"use_config_qty_increments\";s:1:\"1\";s:14:\"qty_increments\";s:6:\"0.0000\";s:25:\"use_config_enable_qty_inc\";s:1:\"1\";s:21:\"enable_qty_increments\";s:1:\"0\";s:18:\"is_decimal_divided\";s:1:\"0\";s:34:\"stock_status_changed_automatically\";s:1:\"0\";s:32:\"use_config_enable_qty_increments\";s:1:\"1\";s:12:\"product_name\";s:15:\"最后的闺秀\";s:8:\"store_id\";s:1:\"0\";s:15:\"product_type_id\";s:6:\"simple\";s:22:\"product_status_changed\";s:0:\"\";s:24:\"product_changed_websites\";s:0:\"\";}',1),(13,1,'a:69:{s:5:\"store\";s:5:\"admin\";s:8:\"websites\";s:4:\"base\";s:13:\"attribute_set\";s:7:\"Default\";s:4:\"type\";s:6:\"simple\";s:12:\"category_ids\";s:2:\"15\";s:3:\"sku\";s:6:\"F01134\";s:11:\"has_options\";s:1:\"0\";s:4:\"name\";s:12:\"演绎无声\";s:5:\"image\";s:24:\"/9/7/9787517200529_1.jpg\";s:11:\"small_image\";s:24:\"/9/7/9787517200529_1.jpg\";s:9:\"thumbnail\";s:24:\"/9/7/9787517200529_1.jpg\";s:7:\"url_key\";s:13:\"9787517200529\";s:8:\"url_path\";s:18:\"9787517200529.html\";s:11:\"page_layout\";s:17:\"No layout updates\";s:17:\"options_container\";s:23:\"Block after Info Column\";s:11:\"image_label\";s:0:\"\";s:17:\"small_image_label\";s:0:\"\";s:15:\"thumbnail_label\";s:0:\"\";s:12:\"msrp_enabled\";s:10:\"Use config\";s:30:\"msrp_display_actual_price_type\";s:10:\"Use config\";s:22:\"gift_message_available\";s:2:\"No\";s:6:\"author\";s:9:\"翟新华\";s:7:\"isbn_10\";s:10:\"7517200526\";s:7:\"isbn_13\";s:13:\"9787517200529\";s:9:\"publisher\";s:12:\"大众文艺\";s:12:\"publish_date\";s:9:\"1/01/2013\";s:5:\"price\";s:7:\"57.0000\";s:13:\"special_price\";s:0:\"\";s:6:\"weight\";s:6:\"0.6000\";s:4:\"msrp\";s:0:\"\";s:6:\"status\";s:7:\"Enabled\";s:12:\"is_recurring\";s:2:\"No\";s:10:\"visibility\";s:15:\"Catalog, Search\";s:21:\"enable_googlecheckout\";s:3:\"Yes\";s:12:\"tax_class_id\";s:13:\"Taxable Goods\";s:8:\"featured\";s:3:\"Yes\";s:11:\"description\";s:6:\"&nbsp;\";s:17:\"short_description\";s:753:\"《演绎无声》是我国第一部以实际感受和案例系统论述演出经纪理论与实践的前沿专著，对希望从事演出经纪活动和观察研究台前幕后的人士具有指导和借鉴意义。作者翟新华从事过导演、摄影师、经纪人等职业，已成功举办有上千场次的演出活动，参与了多部影视剧的制作拍摄，具有丰富的人生经历和文化产业运作经验。本书通过作者翟新华的亲身经历，细述了从策划、组织到运作、实施演出活动时的具体过程，近距离接触各种明星的感受，以及行走于大江南北，在全国各地所发生的成功与失败的曲折故事。\n作者简介\n　　翟新华，山东惠民人，生于1964年，北京\";s:17:\"special_from_date\";s:0:\"\";s:14:\"news_from_date\";s:19:\"2013-07-18 00:00:00\";s:3:\"qty\";s:7:\"25.0000\";s:7:\"min_qty\";s:6:\"0.0000\";s:18:\"use_config_min_qty\";s:1:\"1\";s:14:\"is_qty_decimal\";s:1:\"0\";s:10:\"backorders\";s:1:\"0\";s:21:\"use_config_backorders\";s:1:\"1\";s:12:\"min_sale_qty\";s:6:\"1.0000\";s:23:\"use_config_min_sale_qty\";s:1:\"1\";s:12:\"max_sale_qty\";s:6:\"0.0000\";s:23:\"use_config_max_sale_qty\";s:1:\"1\";s:11:\"is_in_stock\";s:1:\"1\";s:14:\"low_stock_date\";s:0:\"\";s:16:\"notify_stock_qty\";s:0:\"\";s:27:\"use_config_notify_stock_qty\";s:1:\"1\";s:12:\"manage_stock\";s:1:\"0\";s:23:\"use_config_manage_stock\";s:1:\"1\";s:25:\"stock_status_changed_auto\";s